import React from 'react'

import Image from '../components/Image'
import
{
Container,
Row,
Col,
Form,
FormGroup,
Label,
Input

}from 'reactstrap'

const Discover = () => {

    return(
        <Container className="discover-page">
          
            <header className="discover-header">
                <Image image={{width:'100%',height:'100%',alt:'pagne img',src:'/images/pagne.jpg'}} />
            </header>

            <section className="discover-section">

               <div className="filter-div">
        <FormGroup className="form-discover">
            <Label for="exampleSelect">Select</Label>
            <Input type="select" name="select" id="exampleSelect">
            <option>1</option>
            <option>2</option>
            <option>3</option>
            <option>4</option>
            <option>5</option>
            </Input>
      </FormGroup>
 
      <FormGroup className="form-discover">
        <Label for="exampleSelect">Select</Label>
        <Input type="select" name="select" id="exampleSelect">
          <option>1</option>
          <option>2</option>
          <option>3</option>
          <option>4</option>
          <option>5</option>
        </Input>
      </FormGroup>
 
                  
               </div>
            </section>


    <style>{`
    
    .discover-page{
        padding-right:0;
        padding-left:0;
        max-width:100%;
    }

    .header{
        height:30vh;
    }

    .filter-div{
       
    }

    .filter-div::after {
        content: "";
        clear: both;
        display: table;
      }

    

    @media only screen and (max-width:600px){
        .form-discover{
            width:45% ;
            float:left;
        }
    }
    
    `}</style>

        </Container>
    )
}

export default Discover
